import React from 'react';

const NotLogged = () => {
  return (
    <div>
      <h2 className="headingNotLogged1">
        You need to be logged in to view this page
      </h2>
      <h2 className="headingNotLogged2">
        head over to users and pick your user
      </h2>
    </div>
  );
};

export default NotLogged;
